window.bookSummaryJSON = "<p>Matt and Chris have made it home ahead of the undead curse, but at what cost?</p> <p>The dungeon is surrounded, the refugees have made it to safety, but . . . they need food, water, space to recover and rest, and none of these things come cheap. That cost must be paid in mana.</p> <p>Mike and Kelly were sent to bring reinforcements from the park, but they're walking into a meatgrinder, one that will strip the life from them, then raise them to besiege those they love . . .</p> <p>Matt has only one chance . . . lead the refugees, forge them anew into a force that can face the undead, in their tens of thousands.</p> <p>Worst of all . . . the beer's damn well warm.</p>"; 
